import './App.css';
import NavBar from './components/NavBar';
import ItemListContainer from './components/ItemListContainer';
import PropsCallback from './components/ItemCount';
import { useState } from 'react';
import fetchProducts from './components/practicadesuma';


function App() {

  const [cartArticle, setCartArticle] = useState(0)

  return (
<div>
    <NavBar cartArticle={cartArticle}/>
    <ItemListContainer greetings ="Bienvenidos a " greetings1="STADIUM" />
    <PropsCallback setCartArticle={setCartArticle}/>
    <fetchProducts></fetchProducts>
</div>
  );
}

export default App;
